    - ID: "625f32a7-8b24-4b35-8f6f-1464da77bc40"
      Hint: Content
      Value: |
        <p>Central Life Sciences, the makers of Altosid<sup>®</sup>&nbsp;and other effective mosquito control solutions, created the <span style="background-color: #ffffff; color: #242424;">Get Mosquitoes Out of the Picture</span>&nbsp;campaign to help you—MADs and PHOs—communicate with your communities through free mosquito awareness materials.</p>
        <p>We have created a series of posters and door hangers that can be customized for your community or region.</p>
        <p>To learn how we can help promote your mosquito prevention efforts, please complete the contact form to have a member of our team contact you.</p>
        <p>Now more than ever, the products communities are using need to work right the first time and stand the test of time. Products with longer residual control allow professionals to do more with fewer applications and require a smaller workforce which allows staff flexibility.</p>
        <p>To learn more about Central Life Sciences, our long residual products, and other mosquito resources, please visit <a href="http://www.centralmosquitocontrol.com">CentralMosquitoControl.com.<br />
        <br />
        </a></p>
